import styled from 'styled-components';

const BigButton = styled.button`
  font-size: 1.2rem;
  background: var(--blue);
  border: 1px black solid;
  border-radius: 10px;
  padding: 0;
  margin: 0;
  &:hover {
    color: white;
    cursor: pointer;
  }
`;

export default function RemoveFromCart({ id }) {
  return (
    <BigButton type="button" title="Remove this Item from Cart">
      Remove Item
    </BigButton>
  );
}
